          <Route exact path="/singleblog/:slug" element={<NewsDet />} />

          <Route exact path="/sidebar" element={<Sidebar />} />
          <Route exact path="" element={<BlogDet />} />

        */}
        </Routes>
      </Router>
    </div>
  );
}

export default App;
